import React from 'react';
import "./welcome.css";
import tutorial from "../../assets/tutorial.mp4";
import { useNavigate } from 'react-router-dom';

navigate = useNavigate();
const Welcome = ( useNavigate) => {

    const handleGetStarted = () => {
        navigate('/dashboard');
    }

    return (
        <div className="welcome">
            <video className="welcomeVideo"  controls muted autoPlay loop>
                <source src={tutorial} type="video/mp4" />
             </video>
             <div className="buttonContainer">
                <button className="welcomeButton" onClick={handleGetStarted}>Get Started</button>
             </div>
        </div>
    )
};

export default Welcome;
